import React from 'react';
import picture from '../../images/climb3.jpeg'

import './AboutMe.css';

const AboutMe = ({id}) => {
    return(
            <div className = 'center mt5' id = {id}>
                    <h1 className = 'tc pt5 fw5'>About Me</h1>
                    <div className = 'bb w-50 center'>
                    </div>
                        <div className = 'flex flex-wrap justify-around mt3'>
                            <div className = 'relative o-90 imgWrapper flex flex-wrap items-end ma2'>
                                <img src = {picture}
                                     className="br3 ba b--black-10 content dim"
                                     alt = ''/>
                                <div className = 'text white-90 i pa2 hidden'>
                                    <h2>Squamish, BC</h2>
                                    <h3>Grand Wall Base Area</h3>
                                    <p>Arrowroot, 5.10b</p>
                                </div>
                            </div>

                            <div className = 'infoText shadow-5 br3 ma2'>
                                <h4 className = 'ma2'>Hi, I'm Colton.</h4>
                                <p className = 'lh-copy ma2'>As long as I can remember, I've had a passion for building things, technology, music, and extreme sports. Whether it's building an acoustic guitar from scratch during high school, designing and tinkering with my own ideas for guitar pedals, or teaching myself how to build this website, I'm always learning how things that interest me work by taking them apart and building them myself. </p>
                            </div>
                        </div>
            </div>
 );
}

export default AboutMe;
